import React from "react";
import data from "./Data"; // your large JSON
import LineChart from "./Components/LineChart";
import DonutChart from "./Components/DonutChart";
import "./Dashboard.css";
import {
  Chart as ChartJS,
  CategoryScale,   // ✅ this fixes "category" scale error
  LinearScale,
  PointElement,
  LineElement,
  ArcElement,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  ArcElement,
  Tooltip,
  Legend
);

function App() {
  return (
    <div className="dashboard">
      <h1>Food Prices Dashboard</h1>
      <div className="chart-grid">
        <div className="chart-card">
          <h2>Product Trend Over Time</h2>
          <LineChart data={data} />
        </div>
        <div className="chart-card">
          <h2>Regional Breakdown (Donut)</h2>
          <DonutChart data={data} />
        </div>
      </div>
    </div>
  );
}

export default App;
